      '\u003ch1\u003eChargeback Instantly\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eA shopper in Australia once filed for a chargeback when she purchased 48 boxes (not rolls) of toilet paper. That\'s enough toilet paper to last 12 years!\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eCharged for something you didn\'t agree to? DoNotPay will help you get a refund for any transaction from your bank. Whether you were the victim of a delivery problem, an unfulfilled refund, a duplicate charge, or a breached account, we\'ll use the evidence you supply to either get you a refund or secure your account.\u003c/div\u003e',
