      '\u003ch1\u003eTSA Support\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eIn 2020, Terry Rolin handed his daughter his life savings of $82,373 to open a joint bank account between them, but the TSA stopped his daughter at the airport and confiscated the money. Rolin sued the TSA for wrongfully seizing the money and holding it for 6 months with no evidence or criminal charges.\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eDoNotPay can help improve your TSA experience by 1) scheduling your TSA pre-check appointment so you can skip the line, 2) filing complaints and reports against rude or disrespectful TSA agents so that they\'re held accountable, and 3) asking any questions you have to the TSA for you, so you can get answers without the long wait times.\u003c/div\u003e',
