      '\u003ch1\u003eClinical Trials\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eIn 2015, NASA paid participants $5,000 per month to lie in bed for 60 days. The bed rest study helped NASA research the effects of zero gravity space travel on the human body. Participants could make up to $15,000 just from lying in bed.\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003ePaid clinical trials and online behavioral studies are some of the easiest ways to make extra money while giving back to the community. By entering basic information like your age, gender, and location, DoNotPay will match you with the best paid studies in your area, which can be as simple as an online health questionnaire. Once you find a study you like, press the "Contact Now" button, and we\'ll contact the researchers on your behalf.\u003c/div\u003e',
