      '\u003ch1\u003eEIN Registration\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003e An Employer Identification Number can help protect you from identity theft. When vendors or customers ask for your credit information, you can use your EIN rather than your personal Social Security Number.\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eIf you’ve started a new business, trust, or other organization that files taxes or pays employees, you must have an Employer Identification Number! These numbers don’t expire, but you’ll need to renew them whenever you change the structure of your organization, such as changing leadership or hiring more employees. DoNotPay can help you register for a new EIN for free and get your ID in as soon as a day!\u003c/div\u003e',
