      '\u003ch1\u003eFuel Rewards\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eFuel rewards programs can save you anywhere from 5 cents to 25 cents per gallon of fuel.\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eDid you know that you can save money on gas by signing up for fuel rewards? Nearly all gas stations (Shell, Exxon, Krogers, etc.) have fuel rewards programs where you can earn points and redeem them as credit to save on your gas. DoNotPay can help you sign up for a rewards account and keep track of your fuel rewards balance, so you know how much you can save!\u003c/div\u003e',
