      '\u003ch1\u003e83(B) Elections for Businesses\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eYou only have 30 days to file an 83(B) election after the shares are granted.\u003c/p\u003e\n  \u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eAn 83(B) election is a way for employees (and other shareholders) to lower the taxes they owe on shares. Rather than paying taxes on the value of the shares when they vest, they can pay based on the value of the shares when they were first granted. Usually you have to fill out a special form, mail a hardcopy to the IRS via certified mail, and include a return envelope, but you can do it all automatically through DoNotPay.\u003c/div\u003e',
