      '\u003ch1\u003eDelete Old Accounts\u003c/h1\u003e\n\u003cblockquote\u003e\n  \u003cdiv class="line" \u003e\u003c/div\u003e\n  \u003cdiv class="icon"\u003e\n    \u003cimg src="/static/icon/did-you-know.svg" alt="" /\u003e\n  \u003c/div\u003e\n  \u003cdiv class="content"\u003e\n    \u003ch1\u003eDid you know\u003c/h1\u003e\n    \u003cp\u003eEven if you delete an account, in most cases, your information isn’t immediately wiped. For example, Uber retains your information for up to 30 days after you delete your account.\u003c/p\u003e\n\u003c/div\u003e\n\u003c/blockquote\u003e\n\u003cdiv\u003eDeleting an old account can be difficult if you don’t remember your login credentials and can’t reset your password. In most cases, you’ll have to get ahold of the company support teams directly, If you have an old account that you want to delete but don’t know how to, DoNotPay can contact the service provider on your behalf and request for your account and all of your personal information saved under it to be deleted.\u003c/div\u003e',
